module.exports = JSON.parse('[{"id":1,"title":"#WEGO","content":"Los salarios y contratos de las jugadoras no se acercan en lo mínimo al de sus colegas masculinos, además, hay jugadoras a las que se les hace contrato por máximo 4 meses al año. Por esto, antes, durante y después de su temporada deportiva tienen que buscar trabajos alternos para cubrir sus gastos. Así que decidimos hacer algo.","image":"/img/blog/we-go.jpg","tags":["WEGO ,FUTBOL ,LINDA CAICEDO"],"li":"/proyectos/inter/","date":{"day":"Noviembre ","month":"2022"}},{"id":2,"title":"Mundo sin Plástico","content":"La contaminación por el uso indebido del plástico está llegando a un punto de no retorno. Actualmente, existen 3 grandes islas de estos desechos flotando libremente por los océanos, una de ellas supera el tamaño del estado de Texas en los Estados Unidos. Inter Rapidísimo decidió hacer algo, promover el empleo responsable del plástico en Colombia, o usar alternativas a este material, como su nueva bolsa hecha a base de yuca que al contacto con el agua, se convierte en comida para peces.","image":"/img/blog/mundo-sin-plastico.jpg","tags":["MUNDO SIN PLASTICO ,BALLENAS ,MEDIO AMBIENTE"],"date":{"day":"MARZO ","month":"2023"}},{"id":3,"title":"Alcarrito","content":"En Colombia, el comercio electrónico y el emprendimiento han experimentado un crecimiento constante. Tanto es así que, según un informe del 2021 de la Cámara Colombiana de Comercio Electrónico, el comercio electrónico ha sido categorizado como un campo lleno de oportunidades. Este fenómeno ha traído consigo diversos desafíos, ya que para los emprendedores es cada vez más crucial lograr entregas más eficientes en términos de tiempo y con la menor fricción de costos posible.","image":"/img/blog/alcarrito.jpg","tags":["MINIMAL ,MODERN ,DESIGN"],"date":{"day":"AGOSTO","month":"2022"}},{"id":4,"title":"Pago en Casa","content":"La pandemia trajo consigo un crecimiento rápido de transacciones y compras por internet, tristemente, también trajo consigo, estafas y pérdidas en emprendimientos y comercios que apenas se estaban adaptando a este modelo de negocio electrónico.","image":"/img/blog/pago-en-casa.jpg","tags":["MINIMAL ,MODERN ,DESIGN"],"date":{"day":"AGOSTO","month":"2022"}}]');

